import './MyPosts.css';

function MyPosts() {
	return (
		<div>
			My posts
			<div>
				<textarea></textarea>
				
			</div>
			<div className="posts">
				<div className="item1">
					Post 1
				</div>
				<div className="item2">
					Post 2
				</div>
			</div>
		</div>
	)
};

export default MyPosts;
